function createResponseNode(canvas, parentNode, text) {
  const data = canvas.getData();
  const newNodeId = generateId();
  const newNode = {
    id: newNodeId,
    x: parentNode.x + parentNode.width + 50,
    y: parentNode.y,
    width: parentNode.width,
    height: calculateHeight(text, parentNode.width),
    type: "text",
    text,
    metadata: {
      isAIGenerated: true,
      generationType: "response",
      timestamp: Date.now()
    }
  };
  const newEdgeId = generateId();
  const newEdge = {
    id: newEdgeId,
    fromNode: parentNode.id,
    fromSide: "right",
    toNode: newNodeId,
    toSide: "left",
    color: "6"
    // Purple
  };
  data.nodes.push(newNode);
  data.edges.push(newEdge);
  canvas.setData(data);
  canvas.requestSave();
  return newNode;
}
function createPromptNode(canvas, sourceNodes) {
  if (sourceNodes.length === 0)
    return null;
  const data = canvas.getData();
  let avgX = 0;
  let avgY = 0;
  let maxWidth = 0;
  sourceNodes.forEach((node) => {
    avgX += node.x + node.width / 2;
    avgY += node.y + node.height / 2;
    maxWidth = Math.max(maxWidth, node.width);
  });
  avgX = avgX / sourceNodes.length;
  avgY = avgY / sourceNodes.length;
  const newNodeId = generateId();
  const newNode = {
    id: newNodeId,
    x: avgX + 100,
    // Position to the right of the average
    y: avgY - 50,
    // Position slightly above the average
    width: maxWidth,
    height: 100,
    type: "text",
    text: "Enter your prompt here...",
    metadata: {
      isAIGenerated: true,
      generationType: "prompt",
      timestamp: Date.now()
    }
  };
  const newEdges = sourceNodes.map((sourceNode) => {
    return {
      id: generateId(),
      fromNode: sourceNode.id,
      fromSide: "right",
      toNode: newNodeId,
      toSide: "left",
      color: "5"
      // Blue
    };
  });
  data.nodes.push(newNode);
  data.edges.push(...newEdges);
  canvas.setData(data);
  canvas.requestSave();
  return newNode;
}
function updateNodeContent(canvas, node, text) {
  const data = canvas.getData();
  const nodeIndex = data.nodes.findIndex((n) => n.id === node.id);
  if (nodeIndex === -1)
    return;
  data.nodes[nodeIndex].text = text;
  data.nodes[nodeIndex].height = calculateHeight(text, node.width);
  canvas.setData(data);
  canvas.requestSave();
}
function getConnectedNodes(canvas, node) {
  try {
    const data = canvas.getData();
    const connectedNodes = [];
    const incomingEdges = data.edges.filter((edge) => edge.toNode === node.id);
    incomingEdges.forEach((edge) => {
      const sourceNode = data.nodes.find((n) => n.id === edge.fromNode);
      if (sourceNode) {
        connectedNodes.push(sourceNode);
      }
    });
    return connectedNodes;
  } catch (error) {
    console.error("Error in getConnectedNodes:", error);
    return [];
  }
}
function createQuestionNode(canvas, parentNode, question, answer) {
  const data = canvas.getData();
  const questionNodeId = generateId();
  const questionNode = {
    id: questionNodeId,
    x: parentNode.x + parentNode.width + 50,
    y: parentNode.y,
    width: parentNode.width,
    height: calculateHeight(question, parentNode.width),
    type: "text",
    text: `Question: ${question}`,
    metadata: {
      isAIGenerated: true,
      generationType: "prompt",
      timestamp: Date.now()
    }
  };
  const answerNodeId = generateId();
  const answerNode = {
    id: answerNodeId,
    x: questionNode.x + questionNode.width + 50,
    y: questionNode.y,
    width: parentNode.width,
    height: calculateHeight(answer, parentNode.width),
    type: "text",
    text: answer,
    metadata: {
      isAIGenerated: true,
      generationType: "response",
      timestamp: Date.now()
    }
  };
  const parentToQuestionEdgeId = generateId();
  const parentToQuestionEdge = {
    id: parentToQuestionEdgeId,
    fromNode: parentNode.id,
    fromSide: "right",
    toNode: questionNodeId,
    toSide: "left",
    color: "5"
    // Blue
  };
  const questionToAnswerEdgeId = generateId();
  const questionToAnswerEdge = {
    id: questionToAnswerEdgeId,
    fromNode: questionNodeId,
    fromSide: "right",
    toNode: answerNodeId,
    toSide: "left",
    color: "6"
    // Purple
  };
  data.nodes.push(questionNode, answerNode);
  data.edges.push(parentToQuestionEdge, questionToAnswerEdge);
  canvas.setData(data);
  canvas.requestSave();
}
function generateId() {
  return Math.random().toString(36).substring(2, 15);
}
function calculateHeight(text, width) {
  if (!text) {
    return 100;
  }
  const charsPerLine = width / 5;
  const lines = Math.ceil(text.length / charsPerLine);
  return Math.max(100, lines * 20);
}

